import React from "react";
import { Card, Image } from "react-bootstrap";
import image1 from "../../../images/icons/service1.png";
import image2 from "../../../images/icons/service2.png";
import image3 from "../../../images/icons/service3.png";





var skillUp = [
    {
        title:"Web & Mobile Design",
        text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aliquam molestiae praesentium perferendis maxime dolorem quod soluta tempore quisquam cumque reiciendis.",
        img:{image1}
    },
    {
        title:"Graphic design",
        text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aliquam molestiae praesentium perferendis maxime dolorem quod soluta tempore quisquam cumque reiciendis.",
        img:{image2}
    },    {
        title:"Web development",
        text: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Aliquam molestiae praesentium perferendis maxime dolorem quod soluta tempore quisquam cumque reiciendis.",
        img:{image3}
    }
];

const SkillUp = () => {
  return (
    
        <div className="bg-dark">
            {
            skillUp.map(skill => (<Card style={{ width: '18rem' }}>
            <Image  src="../../../images/icons/service3.png" roundedCircle/>
            <Card.Body>
              <Card.Title>{skill.img}</Card.Title>
              <Card.Text>
               {skill.text}
              </Card.Text>
             
            </Card.Body>
          </Card>
            ))}
        
    </div>

  );
};

export default SkillUp;
